import "./GameOver.css"

const GameOver = ({retry}) => {
  return (
    <div>
        <h1>Game Over</h1>
        <h2>A sua pontuação foi</h2>
        <button onClick={retry}>Retry</button>
    </div>
  )
}

export default GameOver
